import React from 'react';
import { Link } from 'react-router-dom';

const LandingPage = () => {
  return (
    <div>
      <h2>Welcome to the Landing Page</h2>
      <p>Click the button below to go to the Auth Page.</p>
      <Link to="/auth">
        <button>Go to Auth Page</button>
      </Link>
    </div>
  );
};

export default LandingPage;
